import React from 'react'

const Video = () => {
    return (
      <div className="video">
        <video width="600" controls>
          <source src="mov_bbb.mp4" type="video/mp4"/>
          <source src="mov_bbb.ogg" type="video/ogg"/>
          Your browser does not support HTML5 video.
        </video>
        <h4>Video Title</h4>
        <p>Youtube Userame</p>
        <p>Views</p>
        <p>Date</p>
      </div>
    );
  }

  export default Video;
